summary.label:
Real time GPS info to help you take right decisions during sailing race.  Set your sailboat performance, race and review your regatta.
Tracking recorder continues when app goes in background, until the race is stopped. The tracks con be edited adding routes and waypoints; tracks can be exported in gpx and kmz format.

features:

- Configure your sailboat and target performance from 2-20kn; 
- Set the start line (RC boat and Pin) and wind direction and intensity;
- Start screen with Countdown,Distance to Line, Time to Line, Time to start;
- Compare your navigation to target;
- Review the track recorded;
- OpenSeaMap cartography (useful waypoints in harbours)
- NMEA Wi-Fi support
This app uses gps in background during race; this can dramatically decrease battery life.
